import React, { useContext } from 'react';
import UserSettingsContext from './components/UserSettingsProvider';
import ExampleComponent from './ExampleComponent';

const App = () => {
  const { userSettings } = useContext(UserSettingsContext);

  return (
    <div style={{ background: userSettings.theme === 'dark' ? '#222' : '#fff', color: '#333' }}>
      <h1>My App</h1>
      <p>Current Theme: {userSettings.theme}</p>
      <p>Interface Language: {userSettings.language}</p>
      <ExampleComponent />
    </div>
  );
};

export default App;
